Breakin&amp;#039; 2: Electric Boogaloo is the sequel to the 1984 breakdancing film Breakin&amp;#039;. It was released the a year after its predecessor by Cannon Films. In some international locations, the movie was released under the title Breakdance 2: Electric Boogaloo.

Breakin&amp;#039; 2 sees the return of Kelly (Lucinda Dickey), Ozone (Adolfo Quinones) and Turbo (Michael Chambers) as they try to stop a developer from bulldozing a community recreation centre. The film also features dancer Viktor Manoel, rapper Ice-T, who returns from the original, and an appearance by (future) pop star Martika.

Like its predecessor, much of the film&amp;#039;s soundtrack was provided by Ollie &amp; Jerry, comprising the duo Ollie Brown and Jerry Knight. The title track, &quot;Electric Boogaloo,&quot; did not hit the pop charts and climbed to only #45 on the R&amp;B chart.
